import Card from '../UI/Card'
import classes from './AddUser.module.css'

export default function AddUser() {

    function handleSubmit(event){
        event.preventDefault()
    }


  return (
    <Card>
    <form onSubmit={handleSubmit}>
        <label className={classes.label} htmlFor='username'>username</label>
        <input className={classes.input} id='userbane' type='text'/>
        <label className={classes.input} htmlFor='age'> Age(Years)</label>
        <input className={classes.input} id='age' type='number'/>
        <button type='submit'> Add user</button>
    </form>
    </Card>
  )
}
